import "./product.css";
import Engineer from "../../img/Krish-e.PNG";

const Product = () => {
  return (
    <div className="a">
      <div className="a-left">
        <div className="a-card">
          <img
            src={Engineer}
            alt=""
            className="a-img"
          />
        </div>
      </div>
      <div className="a-right">
        <h1 className="a-title">Krish-e</h1>
        <p className="a-desc">
        An e-platform for farm mechanisation to improve food security and 
        livelihood.User can make purchases an also   sell their Agri-related 
        commodities on this app. It is an electronic platform for the farmers.
        This app was built using android studio and firebase.
        </p>
      </div>
    </div>
  );
};

export default Product;
